class CompanyComponent {
    constructor(confirmationService, sharedService, companyService) {
        this.confirmationService = confirmationService;
        this.sharedService = sharedService;
        this.companyService = companyService;
        this.editCompanyDisplay = "none";
        this.addCompanyDisplay = "none";
        this.loading = false;
        this.status = 1;
    }
    ngOnInit() {
        this.cols = [
            { field: "companyName", header: "Company Name" },
            { field: "description", header: "Description" },
            { field: "einNumber", header: "EIN Number" },
        ];
        this.getComapnies(this.status);
    }
    handleChange(event) {
        if (event.index == 0) {
            this.status = 1;
            this.getComapnies(1);
        }
        else if (event.index == 1) {
            this.status = 0;
            this.getComapnies(0);
        }
    }
    getComapnies(status) {
        this.loading = true;
        this.lstCompanies = [];
        this.companyService.getAllCompanies(status).subscribe((res) => {
            this.loading = false;
            this.lstCompanies = [];
            if (res.statusCode == 200)
                this.lstCompanies = res.responsePayload;
        }, (error) => {
            this.loading = false;
        });
    }
    showDialogToAdd() {
        this.companyType = "Add";
        //this.hiddenScroll();
    }
    onDeptAddCloseClick(event) {
        if (event.type == "add") {
            this.getComapnies(this.status);
        }
        else if (event.type == "edit") {
            this.getComapnies(this.status);
        }
        this.companyType = "";
    }
    hiddenScroll() {
        try {
            let bodyElement = document.getElementById("modalbody");
            if (bodyElement) {
                bodyElement.classList.add("modal-open");
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, "hiddenScroll");
        }
    }
    displayScroll() {
        try {
            let bodyElement = document.getElementById("modalbody");
            if (bodyElement) {
                bodyElement.classList.remove("modal-open");
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, "displayScroll");
        }
    }
    save() {
        this.displayScroll();
    }
    deactivate(rowData) {
        this.companyService
            .deactivateCompany(rowData.companyDetailsId)
            .subscribe((res) => {
            if (res.statusCode == 200) {
                this.sharedService.add({
                    severity: "success",
                    summary: "Success",
                    detail: res.message,
                });
                this.displayDialog = false;
                this.getComapnies(this.status);
            }
            else {
                this.sharedService.add({
                    severity: "error",
                    summary: "Error",
                    detail: res.message,
                });
            }
        });
    }
    activate(rowData) {
        this.companyService
            .activateCompany(rowData.companyDetailsId)
            .subscribe((res) => {
            if (res.statusCode == 200) {
                this.displayDialog = false;
                this.sharedService.add({
                    severity: "success",
                    summary: "Success",
                    detail: res.message,
                });
                this.getComapnies(this.status);
            }
            else {
                this.sharedService.add({
                    severity: "error",
                    summary: "Error",
                    detail: res.message,
                });
            }
        });
    }
    onAction(rowData) {
        this.company = rowData;
    }
    onRowSelect(data) {
        this.company = data;
        this.companyType = "Edit";
        // this.editemployeeDisplay = "block";
        // this.newCar = false;
        // this.car = this.cloneCar(data);
        // this.displayDialog = true;
        this.hiddenScroll();
    }
    modalClose() {
        this.editCompanyDisplay = "none";
        this.displayScroll();
    }
    closeAddmodal() {
        this.addCompanyDisplay = "none";
        this.displayScroll();
    }
}
