class CategoryComponent {
    constructor(confirmationService, sharedService, categoryService) {
        this.confirmationService = confirmationService;
        this.sharedService = sharedService;
        this.categoryService = categoryService;
        this.editProjectDisplay = 'none';
        this.addProjectDisplay = "none";
        this.loading = false;
        this.status = 1;
    }
    ngOnInit() {
        this.cols = [
            // { field: 'departmentDetailsId', header: 'ID' },
            { field: 'documentCategory', header: 'Project Name' },
            { field: 'status', header: 'Status' },
        ];
        this.getCategories();
    }
    handleChange(event) {
        if (event.index == 0) {
            this.status = 1;
            this.getCategories(1);
        }
        else if (event.index == 1) {
            this.status = 0;
            this.getCategories(0);
        }
    }
    getCategories(status = 1) {
        this.loading = true;
        this.documentCategories = [];
        this.categoryService.getAllDocumentCategory(status).subscribe(res => {
            this.loading = false;
            this.documentCategories = [];
            if (res.statusCode == 200)
                this.documentCategories = res.responsePayload;
        }, error => {
            this.loading = false;
        });
    }
    showDialogToAdd() {
        this.categoryType = 'Add';
        //this.hiddenScroll();
    }
    onDeptAddCloseClick(event) {
        if (event.type == 'add') {
            this.getCategories();
        }
        else if (event.type == 'edit') {
            this.getCategories();
        }
        this.categoryType = '';
    }
    hiddenScroll() {
        try {
            let bodyElement = document.getElementById('modalbody');
            if (bodyElement) {
                bodyElement.classList.add('modal-open');
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, 'hiddenScroll');
        }
    }
    displayScroll() {
        try {
            let bodyElement = document.getElementById('modalbody');
            if (bodyElement) {
                bodyElement.classList.remove('modal-open');
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, 'displayScroll');
        }
    }
    save() {
        this.displayScroll();
    }
    confirm(rowData) {
        this.confirmationService.confirm({
            message: 'Are you sure that you want to Inactivate this data?',
            accept: () => {
                this.delete(rowData);
                //Actual logic to perform a confirmation
            }
        });
    }
    delete(rowData) {
        if (this.status == 1) {
            this.categoryService.deactivateDocumentCategory(rowData.documentCategoryDetailsId).subscribe(res => {
                if (res.statusCode == 200) {
                    this.sharedService.add({ severity: 'success', summary: 'Success', detail: res.message });
                    this.displayDialog = false;
                    this.getCategories();
                }
                else {
                    this.sharedService.add({ severity: 'error', summary: 'Error', detail: res.message });
                }
            });
        }
        else {
            this.categoryService.activateDocumentCategory(rowData.documentCategoryDetailsId).subscribe(res => {
                if (res.statusCode == 200) {
                    this.displayDialog = false;
                    this.sharedService.add({ severity: 'success', summary: 'Success', detail: res.message });
                    this.getCategories(this.status);
                }
                else {
                    this.sharedService.add({ severity: 'error', summary: 'Error', detail: res.message });
                }
            });
        }
    }
    onDelete(rowData) {
        this.documentCategory = rowData;
    }
    onRowSelect(data) {
        this.documentCategory = data;
        this.categoryType = 'Edit';
        // this.editemployeeDisplay = "block";
        // this.newCar = false;
        // this.car = this.cloneCar(data);
        // this.displayDialog = true;
        this.hiddenScroll();
    }
    modalClose() {
        this.editProjectDisplay = "none";
        this.displayScroll();
    }
    closeAddmodal() {
        this.addProjectDisplay = "none";
        this.displayScroll();
    }
}
