class DepartmentsComponent {
    constructor(confirmationService, sharedService, departmentService) {
        this.confirmationService = confirmationService;
        this.sharedService = sharedService;
        this.departmentService = departmentService;
        this.editemployeeDisplay = "none";
        this.addemployeeDisplay = "none";
        this.loading = false;
        this.status = 1;
    }
    ngOnInit() {
        this.cols = [
            // { field: 'departmentDetailsId', header: 'ID' },
            { field: "department", header: "Name" },
            { field: "description", header: "Description" },
            { field: "status", header: "Status" },
        ];
        this.getDepartments();
    }
    handleChange(event) {
        if (event.index == 0) {
            this.status = 1;
            this.getDepartments(1);
        }
        else if (event.index == 1) {
            this.status = 0;
            this.getDepartments(0);
        }
    }
    getDepartments(status = 1) {
        this.loading = true;
        this.lstDepartments = [];
        this.departmentService.getAllDepartments(status).subscribe((res) => {
            this.loading = false;
            this.lstDepartments = [];
            if (res.message == "departments")
                this.lstDepartments = res.responsePayload;
        }, (error) => {
            this.loading = false;
        });
    }
    showDialogToAdd() {
        this.departmentType = "Add";
        //this.hiddenScroll();
    }
    onDeptAddCloseClick(event) {
        if (event.type == "add") {
            this.getDepartments();
        }
        this.departmentType = "";
    }
    hiddenScroll() {
        try {
            let bodyElement = document.getElementById("modalbody");
            if (bodyElement) {
                bodyElement.classList.add("modal-open");
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, "hiddenScroll");
        }
    }
    displayScroll() {
        try {
            let bodyElement = document.getElementById("modalbody");
            if (bodyElement) {
                bodyElement.classList.remove("modal-open");
            }
        }
        catch (ex) {
            this.clientErrorMsg(ex, "displayScroll");
        }
    }
    save() {
        this.displayScroll();
    }
    confirm(rowData) {
        this.confirmationService.confirm({
            message: "Are you sure that you want to Inactivate this data?",
            accept: () => {
                this.delete(rowData);
                //Actual logic to perform a confirmation
            },
        });
    }
    delete(rowData) {
        if (this.status == 1) {
            this.departmentService
                .deactivateDepartment(rowData.departmentDetailsId)
                .subscribe((res) => {
                if (res.message == "Deactivate department successful") {
                    this.sharedService.add({
                        severity: "success",
                        summary: "Success",
                        detail: res.message,
                    });
                    this.displayDialog = false;
                    this.getDepartments();
                }
            });
        }
        else {
            this.departmentService
                .activateDepartment(rowData.departmentDetailsId)
                .subscribe((res) => {
                if (res.message == "Activate department successful") {
                    this.displayDialog = false;
                    this.sharedService.add({
                        severity: "success",
                        summary: "Success",
                        detail: res.message,
                    });
                    this.getDepartments(this.status);
                }
            });
        }
    }
    onDelete(rowData) {
        this.department = rowData;
    }
    onRowSelect(data) {
        this.department = data;
        this.departmentType = "Edit";
        // this.editemployeeDisplay = "block";
        // this.newCar = false;
        // this.car = this.cloneCar(data);
        // this.displayDialog = true;
        this.hiddenScroll();
    }
    modalClose() {
        this.editemployeeDisplay = "none";
        this.displayScroll();
    }
    closeAddmodal() {
        this.addemployeeDisplay = "none";
        this.displayScroll();
    }
}
